import IronHelmImg from './iron-helm.png';

const IronHelm = {
    name: 'Iron Helm',
    type: 'armor::helmet',
    effect: {
        defence: 6,
    },
    image: IronHelmImg,
    value: 70,
};

export default IronHelm;
